charset["金文考釋匯纂(1990-1999)"]="𢱭頒寶啚敝㪤獘弁髟𠬪不勅𤕌垂錞𤔲朿汆大道㝵丁𠂤對盾伐𥿋䛀方鳳夫鈇膚𠬝婦羔鎬郜庚工公光𨺜歸鬼邗𣐺盍虎㜳圂毀惠稽楖谻賈建澗夅丯戒晉就䀠虡亢丂𧙀狸麗夌陵婁翏亂鋁履縷毛矛卯鉚眉昧蒙𡧊民墨目夒能逆廿奴庖朋庀僕𦸗䏿器前虔顉秦寢睘酋逑𧾱𠯄融色商𩰱劭舌申審𨭘氏眎視㥅疋朔虒飤嗣㕖酸遂所𨝄逃𧖨𣪌沱宛亡爲衛𥁕我無五㑄敄𨨡錫相襄享亯校心亞羕爻殽要也冶業𠤕宜㠯易殷尹㐆印嬴油有於于余輿豫閼眢苑鈗慍帀棗造乍章者旨中終冢重洀逐罜注鑄犳丵𧿞䑸俎𡉣𡛫𪯚𫒷𫕝𫭓𫵖𫼁𬐦𬛤";
charset["金文文字考釋匯纂(2000-2015)"]="敖𥚃𧬼卑備啚庳𠓥邊髟表𠬪𨒜賓瀕稟並㗘㙛才采參𣦼倉側粣長敞鬯繛朝勶爯𢕌趩𤕌𥄨醜出𥚹刅吹垂𤔲朿𧴧悤從萃虘達眔帶戴單旦狄帝遰典電簟弔鼎東𠂤對𣄰𣎴噩珥罰𩠙方𩞑封夆馮夫尃巿茀服笰福𠤳㝬复復敢干犅艮羹公巩拲共冓㝅蛊㾶䀇瓜祼光歸馘寒蒿黑曶𠦪户化𢦚褱洹寏瞏黄隓毀𩒳𨗥昏或靃墼及即殛耤丮𠯎㠱加叚賈奸㦰姦柬建諫𡥈劼𦨱堇𡥨巠荆井誩競扃句爵君㽙𪚕侃康丂克䙐夔𦎫剌闌𨚁盠邐曆𥜍麗盭量粦臨𠱠鈴𦅫𠮽遱鹵𤔔𡄹寽呂履縷買茅袤楙懋眉盟覓蔑某母穆乃夒逆恁宁㯱配倗𦊁闢㓲品平匍𥮉僕妻旂齊𪗍啔气臤遣𤖣且顉清人融柔入桑喪殺山邵舍生𦖞眚尸𨸲邿師市視殳疋姝述樹䢦𧗿水朔虒㺇飤宋肅夊歲所索檀㙶餳替𤰖覜脡㣚𢓂𢓊彖退託贎韋爲𢾁文𤵒我吳無午珷戊䛩息屖𠩺衋𧪕夏㳄咸𡩜縣香鄉襄亯項孝校卸燮褻休欨序卹辪學雪鄩噚衍昜鍚姚䌛㫏衣𦣞䧅𩞫弋𥘒易益埶𤞷異裔𢑩𢍰殷引英䧹𤻮嬴庸墉𦤘永用攸幽莤友酉于𩁹魚玉芋獄遹禦𥿎淵𧻚夗𠣩礿䬤則責夨賊閘乍齋宅肇折𢼧朕征爭之祗旨茝黹終舟烐盩鼄𥞏助鑄灷追孳子𠂔俎胙﨤鿆𠵤𢽳𪠊𪠑𪢙𪦧𪪳𪫳𪷢𫁘𫉏𫊟𫊣𫍅𫐃𫖤𫠤𫠨𫠾𫡋𫡜𫢁𫣐𫤵𫧻𫨪𫨱𫨾𫩀𫬌𫬫𫬰𫭓𫮩𫯀𫯤𫳇𫴨𫵔𫸟𫸢𫸤𫹔𫻏𫼆𫾱𫿌𫿢𬂴𬃚𬄜𬆁𬇷𬈄𬉖𬋝𬋸𬌍𬌤𬐘𬐬𬐶𬑁𬒤𬓷𬚪𬚮𬛻𬝧𬣉𬤽𬥦𬨡𬨭𬩂𬰫𬴥𬴵𬴹𬴺𬹜𬹢𬹨𬾺𭤐";
