charset["新甲骨文編"]="𡟓艾安敖䮯八巴癹霸白百柏敗般姅勹苞雹宀保寶豹暴虣𠔁北孛貝𤰇狽備奔皀偪𣴨鼻匕比妣娝啚鄙必庇𠨘畀畢敝婢飶駜濞奰璧鞭邊釆𥾸髟𨒜豩賓兵丙秉并竝剥剝伯帛泊博搏駁𣡌卜逋不步才采𣦼倉曹㯥艸冊𣆑曾𢽝昌長鬯巢朝漅車屮徹臣辰沉䢅曟𨳐爯偁成丞承城宬乘𩫨遟遲齒赤沖舂虫寵雔疇丑醜臭出初除芻雛楚豖畜川傳𦎇吹桘春萅滣逴㲋娕祠𥿆辭此𣥅朿悤从從琮搓达𩣯龖大汏眔帶卩丹單撣旦但淡僤彈禫宕刀盜𤷘得登𨒔㣙杕帝禘典奠㝪弔釣耊耋丁鼎定東涷陡斗豆鬥剢𣈉妬度𠂤𡸠兌陮隊對多妸娥歺𠱫𥩮𪀝兒耳洱爾二發伐凡緐繁反匚方㕫妃非分𨷹焚糞丰妦風豐逢湗鳳缶夫𠬝弗孚刜𦨈服畐祓鳧箙甫斧㝬父阜婦復腹𥫭改匄㕢甘干𡶩剛高膏杲槁槀告𠬳戈戓革𢓜鬲閤各亘庚㪅更工弓厷公宮䐵龏𠬞共冓苟遘古谷鼓瞽蠱雇𠯑歄冎剮官𥿑觀毌祼雚光圭龜巂歸騩鬼癸𣪘䌆𦏧聝馘還亥害圅涵寒𣐺𣻦行蒿豪好𡚽禾合何河姀䢔闔龢寉黑恒𧝒弘虹𨾊鴻𥎦矦厚後乎呼𠦪狐壺觳虍虎唬戶嚛㭉化㕦𢦚畫淮洹萈萑雈圂𧖭𩣇㞷𡉚𡴍皇黃潢𩲡恚彗晦會誨暳昏𡇯䄆火霍獲穫鑊靃𤼥姬基箕稽櫅雞及𨸚吉彶即亟𡜍疾㗊集耤雧几己丮𠯎脊旡季茍洎既祭㠱繼家𢉻嘉豭夾甲斝賈稼戔㦰肩監艱䶬翦見建畕將弜降洚交焦𤓪角教皆街睫截解丯介戒巾斤今金妗晉進盡京晶井汫𥘚妌竟競囧丩九酒紤咎柾就廄舊苴𣻐鞠具𥉁亅夬氒玨𧣇絕爵鷢君麇畯坎侃康亢丂𥝹可克口叩寇夸亏窺𢌳𧷛䖵困𣏔𦎫剌來婡牢老雷㵢櫑𥃇唎𠭰驪李豊禮力立吏利砅栗秝㮚歷𩣫櫟麗𩱇聯良量遼潦竂尞劦𥞥林𠵂粦鄰潾麐麟㐭吝焛夌紷霝𪛈令驑柳六龍嚨瀧龓聾盧鹵魯櫓录陸鹿禄祿麓䜌攣灤侖罗𦟀羅洛𩂣呂旅𧙿履律率馬遤鎷霾買麥曼澫汒尨杗莽髦卯𤕰獏懋枚眉湄每美沬妹鬽寐媚門𦊽夢麋米羋糸宓𥄃𥁑密䛑丏冕面𥄲烕蔑民皿敏名明冥朙鳴命𤤄歾歿莫牟䍒母牡拇木目牧𦨧穆乃艿迺柰囡男南夒秜麑𡥦㲻屰逆𢙤溺年輦廿念娘鳥㘝㚔臬㴪孽宁寍寧嬣𧕝濘牛農辳䢉㚢奴奻虐女爿𦙀旁龐配轡𣦱朋倗彭伓皮陴貔𩫫辟嬪品牝甹攴僕瀑七妻戚祈棊齊企杞𣏌呇啟气棄㓞千䇂臤前歬朁遣欠㐸羌戕琷溬牆㛨且妾𡝍侵秦禽嫀寢沁慶磬卭丘秋汓裘蛷區曲取娶齲去泉孉犬雀㱿冄冉瀼人壬刃任妊扔日戎肜冗宂肉如汝乳鄏入朊若洒卅塞三散𢿱桑喪𡠏歮瑟嗇𠻮𥢺森霎山芟杉檆羴蟺商滳上尚少𠧙卲舌舍𢎤射涉䠶𡠽麝𪋧申身𢓠娠深紳升生牲聲省尸𢼊師溼十石食祏姼史矢豕使宩屎駛氏示市事室笹視奭釋㝊首受㖟售獸殳疋尗姝殊秫孰熟黍蜀鼠朮戍束庶尌樹爽水順司㚸絲㺇死巳四汜兕祀飤𤉡肆㣈𦙣宋叟夙𡖊速驌𩱖𩱫𥝩㒸祟𠭥歲穗孫𠣬索它沓遝臺𡘙貪覃潭檀䊤𧫿叹探唐濤陶替天田畋㐁条𠧪聑聽𥀿𡈼通同桐童𣪌突𨑒𢓊徒涂梌土兔彖退𢓴屯𡱂豚臀乇橐妥洼𣵾娃外宛萬亡王网望朢微為韋唯圍𩏏尾委未畏衛昷𥁕温溫文聞問我硪巫𢀣五午武舞勿戊物夕兮西昔析息奚厀膝嬉熹錫羲習騽喜𠰝係𡭴𦵯下夏先㳄弦咸臽宪陷霰獻相香鄉襄亯𦴒饗向象項宵小效媟燮心辛昕訢𠷓新囟䏤星𩥍杏幸姓婞興兄熊休羞宿戌須敘宣薛辥學雪䨮血𥄎旬巡尋侚訊㝞亞婭厃延言妍炎嵒虤㕣㫃𨒄衍酓妟焱燕鬳央羊昜陽恙夭爻堯宎曣埜野夜枼頁一伊㛄夷宐𢓚宜䧅疑彝乙以㠯乂弋伇亦邑役易㣇疫栺益埶豛異逸𡎐義𢍰翼𩙺因殷陰㐺乑㹞寅尹引𢏂飲㱃印褮膺庸雍墉雝永用攸幽由斿猶友有酉卣又右幼𤴨囿祐扜于盂竽俞雩魚湡漁輿雨圉玉聿育御毓禦鬻鬱淵鳶元爰袁員遠夗曰月戉刖樂龠𩱶暈雲允孕帀雥𡿧灾災甾栽烖𣅁宰䣬再在𩛥𦣣臧葬鑿蚤棗𧎮𠴵則責擇昃𠭯乍宅翟占𦩻㕚召𠧞肇𥃝折㪿者貞姫裖振朕震爭姃蒸正之㞢卮祗戠直姪聀執嬂止旨沚砋黹徵至制陟徏徝智彘置雉廌疐𥏼中𦬕終仲妕重眾舟州周洀婤𥂕肘呪胄晝帚朱㦵誅鼄竹逐𥞏注壴祝鑄叀耑專𠨎灷䧘妝樁隹追椎沝墜𣵠涿灂茲玆淄髭頿子𠂔自宗走奏卒𥎩族祖朘㝡尊左𥙀作坐𡊎𢼎㓿𠇦𠊡𠯤𠰣𠵤𡘑𡚱𡚿𡛏𡜐𡟙𡠵𢀛𢗦𢦔𣍪𣏮𣼊𣼳𤈠𦰩𪞿𪥩𪦷𪧭𪭑𪰊𪷾𪻍𪾏𪾙𫅊𫅓𫇆𫊟𫊣𫔺𫙇𫩨𫭠𫰉𫰊𫰔𫲺𫸥𫻨𬂤𬇖𬒯𬔖㭉";
charset["新甲骨文編(增訂本)"]="𡟓艾安晻敖奡䮯八巴癹罷霸白百柏敗般勹苞雹宀保飽寶抱豹暴虣卑𠔁北孛貝𤰇狽備奔偪𣴨鼻匕比妣啚鄙必庇𠨘畀畢敝婢飶駜𤏹濞𥣇璧𡚤編鞭邊髟𨒜賓瀕𧲏兵丙秉并病竝𣥠伯帛泊博搏駁𣡌卜逋不步才采蔡參倉曹㯥𣍘艸冊𣆑曾燀昌長鬯巢朝漅車屮徹臣辰沉䢅𨳐爯偁成丞承城宬乘𩫨遟遲齒叱赤𢽟沖舂虫𣕾雔疇丑醜臭出初芻雛楚豖畜川傳吹桘春萅逴娕娖茨祠𥿆辭此𣥅朿賜悤从從琮𩥙达𩣯龖大汏眔帶戴卩丹單撣旦僤禫宕刀得登𨒔㣙鏑杕弟帝禘顛奠㝪弔耊耋丁頂鼎定東涷侗姛斗豆鬥剢𣈉妬度𠂤兌陮對盾多𡖇妸娥𣎴歺𠱫𪀝兒耳洱爾二刵發伐凡緐反匚方防㕫妃非分焚燓糞丰妦風逢奉湗鳳缶𡜊夫𠬝弗孚刜服枹畐鳧箙蝠甫斧㝬父阜复婦復腹𥫭改匄㕢甘𠭖敢干𡶩剛高羔膏杲槁槀告戈戓割革𢓜鬲閤各亘庚㪅更工弓厷公宮龏廾𠬞共冓苟遘古𠑹谷鼓瞽蠱雇𠯑歄冎剮官觀冠祼雚光圭龜巂歸騩鬼癸𣪘䌆𦏧鯀𩫏聝馘還亥害𡟲圅涵寒𣐺𣻦熯行蒿豪𩫚好𡚽訶禾合何河姀䢔闔龢寉黑恒恆𧝒弘虹𨾊鴻𥎦矦厚後乎呼𠦪狐壺觳虍虎唬戶户濩㭉化㕦𢦚畫澅淮洹萈萑雈圂𩢯㞷𡉚𡴍皇黃潢𩲡恚彗晦會誨暳昏䄆火或𨾏霍獲穫鑊靃𤼥姬箕稽櫅雞躋羈及𨸚吉彶即亟𡜍疾棘㗊集耤雧几己丮脊旡季茍洎既祭㠱家嘉豭夾甲斝賈稼戔㦰肩監艱䶬囏翦見建薦姜畕將弜降洚𤓪角教皆街𡵒疌睫截𢧵解丯介戒犗巾斤今金堇晉進盡京晶井汫妌竟競囧丩鳩鬮九𠛩酒紤咎柾就廄舊拘苴罝𣻐𥷚𢍣具𥉁𥆞亅氒玨𧣇㸕爵鷢君𦉼麇畯坎侃康亢丂可克刻口叩寇哭夸亏窺𢌳𧷛䖵困𣏔𦎫剌來婡狼牢勞老雷㵢櫑𥃇頪唎𠭰驪豊禮力立吏丽利砅栗㮚歷𩣫櫟麗𩱇憐聮聯良梁兩量遼潦竂尞劦𡿪𥞥林𠵂粦鄰潾臨麐麟㐭吝焛夌霝令驑柳六龍嚨瀧龓聾𧇄盧鹵魯櫓录彔陸鹿禄祿麓䜌攣灤𤔔侖𦟀羅洛𩂣呂旅履律率𩴐馬遤霾買麥曼澫芒尨莽罞髦卯冒楙獏懋枚眉湄每美沬妹𢦹鬽寐媚門𦊽夢麋米羋宓𥄃𥁑䛑丏冕面繆𥄲烕蔑民捪皿敏名明眀冥朙鳴命𤤄歿殁莫牟䍒母牡拇木目牧𦨧穆乃艿迺柰男南夒能秜𡥦㲻屰逆匿溺年輦廿念娘鳥㘝㚔臬㴪聶孽寍寧嬣濘牛辳䢉奻虐女爿𦨗𦙀旁龐㯱配轡朋彭伓炋皮陴貔羆𩫫辟𠯯嬪品𣎳牝甹攴捊瀑七妻戚霋祈棊齊企杞𣏌呇啟晵气棄㓞千䇂奷臤牽掔朁遣欠㐸羌戕溬牆㛨且妾𡝍侵𣪄秦禽嫀寢𡪢沁慶磬丘秋裘蛷區驅取娶齲去权泉孉犬雀㱿冄冉瀼人壬刃任妊日戎肜融冗宂肉如汝乳辱入𩱜朊若卅塞三彡散𢿱桑喪𡠏掃埽歮瑟嗇𥢺森沙殺山芟杉刪删檆羴蟺商滳上尚少𠧙卲舌舍𢎤射涉䠶𡠽麝𪋧申身罙𢓠娠深紳沈宷升生阩牲聲省尸師十石食祏姼史矢豕使屎駛氏市事室冟笹視釋㝊守首受㖟獸殳疋尗杸叔姝殊秫孰熟𦉶黍蜀鼠朮戍束庶尌樹衰帥爽水司㚸虒絲㺇死巳四汜兕祀姒𤉡肆㣈宋叟叜欶夙𡖊速餗𩱫𥝩祟𠭥歲穗𦄑孫𠣬索它沓遝臺貪覃潭檀䊤𪉲𪉷𧫿叹探唐濤陶忒厗替𤾕天田畋㐁条𠧪聑聽𥀿𡈼通同桐童𣪌突𨑒𢓊徒涂土兔彖退𢓴屯𡱂豚臀乇橐𪓽鼉妥洼𣵾娃外宛萬亡王网罔望朢𣁋烓微為韋唯圍爲𩏏尾委未畏衛昷𥁕溫文聞我硪巫無五午武舞勿戊物寤夕兮西昔析息奚厀膝嬉熹羲習騽襲洗喜係祫𦵯舝下夏先㳄弦咸宪陷縣霰獻相香鄉襄絴亯𦴒饗向象項宵小媟燮心辛忻𠷓新歆囟䏤星鮏𩥍杏幸姓𡴘興兄休羞宿岫戌須宣旋眴薛辥學雪䨮血𥄎旬巡尋迅侚徇訊亞婭厃延言妍炎姸嵒虤㕣㫃𨒄酓焱燕鬳央羊昜陽恙𦠂爻堯蕘杳要曣噎夜枼頁一伊医㛄夷宐𢓚宜䧅痍疑彝乙以㠯攺弋伇亦㚤邑役易㣇栺𧈻益埶𤞷異逸𡎐晹㓷義𢍰劓翼𩙺因殷陰㹞寅尹引𢏂飲㱃印膺癭庸雍墉雝永踊用攸幽由油斿猶友𣏀有酉卣又右幼𤴨柚囿祐于㚥余盂臾竽俞雩魚喁湡榆漁踰雨圉玉聿育御毓禦鬱淵鳶元爰袁員邍遠夗苑曰月戉刖岳樂龠暈云勻雲允孕𡢘帀雥𡿧灾災甾栽烖𣅁宰䣬再在𩛥𠵃瓚𦣣臧葬鑿𧎮𠴵則責笮擇夨昃𠭯乍宅翟占𦩻㕚召兆𠧞旐罩肈肇𥃝折㪿者貞栕姫裖振朕震爭姃蒸正之㞢祗隻戠直姪聀執嬂樴止旨砋黹徵至陟徏徝智彘置雉廌疐𨖹中𦬕終仲重眾舟州周洀婤𥂕妯肘呪胄晝帚朱誅鼄竹逐𥞏主助注壴祝鑄叀耑專𠨎灷䧘妝樁隹追椎沝𣵠酌斀灂孖淄髭頿子𠂔自宗走奏卒𥎩族祖朘㝡尊䞢𠂇左𥙀作坐𡊎𢼎㓿𠇦𠉄𠊡𠯤𠰣𡚱𡚿𡛏𡛼𡜐𡟙𡠵𡡲𡵂𢀛𢗦𢦔𣍪𣏮𣼊𣼳𤋟𦰩𪞌𪟹𪠾𪥩𪦷𪦾𪧭𪭑𪷾𪺐𪻍𪾏𪾙𫅊𫅓𫇆𫊟𫊣𫏂𫔺𫠩𫠭𫡜𫢁𫦀𫦄𫦎𫧖𫨶𫩀𫩁𫩨𫪋𫭠𫮩𫯀𫯦𫯺𫰊𫰔𫰧𫲘𫲺𫳒𫳗𫳛𫶟𫸥𫸵𫹉𫹕𫹢𫹳𫺝𫻨𫻪𫻯𫻸𫾹𫿍𬀈𬀐𬁜𬂤𬅾𬆤𬆥𬆬𬇖𬇾𬉖𬔖𬙜𬛧𬛫𬟧𬟭𬥢𬪹𬯂𬯪𬯭𬴲𬵃𭅺𭑈𭓃𭔒𭛵𭮹𮁧𮫌㭉";
